import React, { useState } from 'react';
import { Tab, Container, Nav, Row, Col, Form } from 'react-bootstrap';
import './Admin.css';
import 'bootstrap/dist/css/bootstrap.min.css';

export const User = () => {
  const [role, setRole] = useState('ROLE');
  return (
    <Container>
      <div className="admin-card">
        <h2 className="admin-card-title">Create User</h2>
        <Form className="admin-form">
          <p className="admin-input-title">Username</p>
          <input className="admin-input" placeholder="Username.."></input>
          <input className="admin-input" placeholder="Password.."></input>
        </Form>
        <DropdownButton title={role}>
          <Dropdown.Item onClick={() => this.setState({ orderType: 'BUY' })}>
            BUY
          </Dropdown.Item>
          <Dropdown.Item onClick={() => this.setState({ orderType: 'SELL' })}>
            SELL
          </Dropdown.Item>
        </DropdownButton>
      </div>
    </Container>
  );
};
